%[text] %[text:anchor:H_2dc7] ## Background
%[text] Rotating or reciprociating machinery such as engines, compressors, motors, and turbomachinery (such as the type found in rocket engines), will inherently, due to the nature of the machine operation, have a presence of vibration. This vibration may lead to excessive wear of bearings, crack initiation, loosening of fasteners, and/or mechanical failure (Rao, 2004).
%[text] One of the primary culprits of this vibration is typically the presence of unbalanced mass in at least one of the mechanical components in the rotating machine assembly, or multiple across the entire assembly. To mitigate, or lessen this effect, *balancing* of components and assemblies is performed during the manufacturing process.
%[text] %[text:anchor:H_1296] ## Purpose
%[text] The purpose of this script is to exercise the fundamentals of vibration control by executing established procedures on performing balancing of rotating machines via numerical methods.
%[text] %[text:anchor:H_5944] ## Scope
%[text] Several scripts will be authored on the subject matter, specifically, plotting transmissibility (in mechanical vibration, this is the ratio of the force transmitted to the force applied), vibration amplitudes, resonant frequencies of vibration absorbers, and two-plane balancing.
%%
%[text] %[text:anchor:H_10c5] ### Plotting of Transmissibility
%[text] (Rao, pp. 714-715, 2004)
%[text] The variation of transmissibility of a single-degree of freedom system with the frequency ratio, given by the transmissibility or transmission ratio $T\_r$ equation below, corresponding to $&dollar&;\\zeta = 0.0, 0.1, 0.2, 0.3, 0.4,&dollar&;and 0.5&dollar&;$ is to be plotted.
%[text] $T\_r = \\frac{F\_T}{F\_0} = \\left\\{ \\frac{k^2 + \\omega^2 c^2} {(k - m \\omega^2)^2 + \\omega^2 c^2} \\right\\} ^{(1/2)}\n\\\\\n\\\\\n\\hspace{1.1cm} =\\left\\{ \\frac{1 + (2 \\zeta r)^2} {(\[1 - r^2\]^2 + (2 \\zeta r)^2} \\right\\} ^{(1/2)}\n$         (Eq. 1)
%[text] where $r=\\frac{\\omega}{\\omega\_n}$ is the frequency ratio.
%%
%[text] The program plots the variation of transmissibility as a function of the frequency ratio using Eq. 1.
for j = 1:5 % the \zeta steps
    zeta = j*0.1;
    for i = 1:1001 % \zeta curve points (# of samples)
        w_wn(i) = 3*(i-1)/1000; % create an array w_wn (frequency ratio) that holds the value of w_wn for every \zeta, the limit is 3
        T(i) = sqrt((1 + (2*zeta*w_wn(i))^2) / ((1-w_wn(i)^2)^2 + (2*zeta*w_wn(i))^2));
        % for every i, T is calculated with w_wn as a func of i; 
        % the output of every loop is stored in the T array
    end
    plot(w_wn,T); % plot the freq ratio on the x-axis, T on the y
    hold on;
end
%%
% Add chart labels.
xlabel('w/w_n');
ylabel('Tr');
gtext('zeta = 0.1');
gtext('zeta = 0.2');
gtext('zeta = 0.3');
gtext('zeta = 0.4');
gtext('zeta = 0.5');
title('Vibration Transmissibility');
grid on;
