%[text] %[text:anchor:H_81a4] ### Vibration Amplitude of Masses of Vibration Absorber
%[text] (Rao, pp. 715-717, 2004)
%[text] A vibration absorber (e.g. a shock absorber mechanism) is added to a machine or system to reduce it's amplitude of vibration after being subjected to an external force whose excitation frequency nearly coincides with a natural frequency of the system. The absorber is designed such that the natural frequencies of the resultant system (i.e., the composite system) are as far away from the excitation frequency, as practically possible.
%[text] %[text:anchor:H_7fc6] #### Vib Analysis Procedure
%[text] 1: System model: The analysis of the dynamic vibration absorber is performed by idealizing the machine as a single-degree of freedom system, then when an auxiliary *damped* vibration absorber of mass $m\_2$ is attached to the machine of mass $m\_1$, the resulting two-degree of freedom system will look like Figure 9.38 below.
imshow('Fig.9.38_Damped_dynamic_vibration_absorber.png')
%%
%[text] 2: Governing equations: The variation of amplitude of vibration for the two-degree of freedom system (Fig. 9.38), are derived from the equations of motion of the masses $m\_1$ and $m\_2$, which are:
%[text]  $m\_1 \\ddot x\_1 + k\_1x\_1 + k\_2(x\_1 - x\_2) + c\_2( \\dot x\_1 - \\dot x\_2) = F\_0sin(\\omega t)$
%[text] $m\_2 \\ddot x\_2 + k\_2(x\_2 - x\_1) + c\_2(\\dot x\_2 - \\dot x\_1)= 0$
%[text] By assuming an exponential solution (since the system has damping, the energy is expected to decay exponentially with time),
%[text] $x\_j(t) = X\_je^{i \\omega t}, j = 1, 2$
%[text] and the absorber design parameter: $\\omega^2 = \\frac {k\_2} {m\_2} = \\frac {k\_1} {m\_1}$
%[text] By designing the vib absorber using the above design parameter, the amplitude of vibration of the machine, while operating at its original resonant frequency, will be zero (ideally, but given the other factors at play, this will not be the case in practice ? ). Indicating the vib absorber is maximizing its function, to reduce the amplitude of vibration of the machine ($X\_1$).
%%
%[text] 3: Solution of governing equations
%[text] The variations of vibration amplitudes for the main machine and absorber may be written as:
%[text] $\\frac {X\_1} {\\delta\_{st}} = \\left \[ \\frac { (2 \\zeta g)^2 + (g^2 - f^2)^2 } { (2 \\zeta g)^2 (g^2 - 1 + \\mu g^2)^2 + \[\\mu f^2 g^2 - (g^2 - 1) (g^2 - f^2) \]^2} \\right\]^{1/2}$        Eq. 9.146
%[text] 
%[text] $\\frac {X\_2} {\\delta\_{st}} = \\left \[ \\frac { (2 \\zeta g)^2 + f^4 } { (2 \\zeta g)^2 (g^2 - 1 + \\mu g^2)^2 + \\left \[ \\mu f^2 g^2 - (g^2 - 1)(g^2 - f^2) \\right \]^2 } \\right \]^{1/2}$        Eq. 9.147
%[text] where, 
%[text] $\\delta\_{st} = \\frac {F\_0} {k\_1}$,  is the static deflection of the main mass, in terms of the max amplitude of the forcing function and the machine's isolator- stiffness.
%[text] Given the following data:
%[text] Ratio of natural frequencies,$f = \\frac {\\omega\_a} {\\omega\_n} = 1$, Damping ratio, $\\zeta = 0.1$ and $0.5$, Mass ratio $\\mu = \\frac {m\_2} {m\_1} = 0.05$ and $0.1$.
%[text] Let the forced frequency ratio $= g = \\omega / \\omega\_n$.
%[text] - This is the ratio of the forcing function's harmonic frequency, to the natural frequency of the composite system. \
f = 1;
% For zeta = 0.1, mu = 0.05
zeta = 0.1;
mu = 0.05;
g = 0.6:0.001:1.3; % Forced frequency ratio, a row vector; this will be the x-axis

% Store common variables used across both equations
tzg2 = (2.*zeta.*g).^2; % .* and .^ element wise operation
g2_1mug2_2 = (g.^2 - 1 + mu*g.^2).^2;
muf2g2_2par = (mu.*f.^2.*g.^2 - (g.^2 - 1).*(g.^2 - f.^2)).^2;
%%
% Calc and generate plots for transmissibility, the variation of
% transmission ratio X1r with forced frequency ratio g
% I.e., Effect of damped vibration absorber on the response of the machine

X1r = (((tzg2) + (g.^2 - f.^2).^2)./(tzg2.*g2_1mug2_2 + muf2g2_2par)).^(1/2);
plot(g,X1r) %[output:526fecff]
hold on; %[output:526fecff]
X2r = (((tzg2) + f.^4)./((tzg2).*g2_1mug2_2 + muf2g2_2par)).^(1/2);
plot(g,X2r) %[output:526fecff]
hold on %[output:526fecff]
%%
% For zeta = 0.1, mu = 0.1
zeta = 0.1;
mu = 0.1;
g = 0.6:.001:1.3;

% The below subroutines are being superseded by the X1r and X2r
% subroutines.

%tzg2 = calc_tzg2(zeta,g); % Subroutine calculates: (2*zeta*g)^2
%g2_f2_2 = calc_g2_f2_2(g,f); % Subroutine calculates: (g^2 - f^2)^2
%g2_1mug2_2 = calc_g2_f2_2(g,f);
%muf2g2_2par = calc_muf2g2_2par(mu,f,g);
%%
% Add chart labels.
xlabel('g'); %[output:02beb62e]
ylabel('X1r and X2r'); %[output:02beb62e]
%gtext('X1r, zeta = 0.1, mu = 0.05');
%gtext('X2r, zeta = 0.1, mu = 0.05');
legend('X1r_{machine}, zeta = 0.1, mu = 0.05', 'X2r_{absorber}, zeta = 0.1, mu = 0.05'); %[output:02beb62e]
title('Vibration Transmissibility'); %[output:02beb62e]
grid on; %[output:02beb62e]
%%
% Call subroutines to calc X1r and X2r
X1r = calc_X1r(zeta,g,f,mu);
X2r = calc_X2r(zeta,g,f,mu);
%%
plot(g,X1r) %[output:1faf9f5f]
hold on; %[output:1faf9f5f]
plot(g,X2r) %[output:1faf9f5f]
hold on; %[output:1faf9f5f]
legend('X1r_{machine}, zeta = 0.1, mu = 0.05', 'X2r_{absorber}, zeta = 0.1, mu = 0.05','X1r_{machine}, zeta = 0.1, mu = 0.1', 'X2r_{absorber}, zeta = 0.1, mu = 0.1'); %[output:1faf9f5f]
%%
% For zeta = 0.5, mu = 0.05
f = 1;
zeta = 0.5;
mu = 0.05;
g = 0.6:.001:1.3;

% Call subroutines to calc X1r and X2r
X1r = calc_X1r(zeta,g,f,mu);
X2r = calc_X2r(zeta,g,f,mu);
%%
plot(g,X1r) %[output:521064e8]
hold on; %[output:521064e8]
plot(g,X2r) %[output:521064e8]
hold on; %[output:521064e8]
%lgd = legend('X1r_{machine}, zeta = 0.1, mu = 0.05', 'X2r_{absorber}, zeta = 0.1, mu = 0.05','X1r_{machine}, zeta = 0.1, mu = 0.1', 'X2r_{absorber}, zeta = 0.1, mu = 0.1', 'X2r_{absorber}, zeta = 0.5, mu = 0.05');
%%
% For zeta = 0.5, mu = 0.1
f = 1;
zeta = 0.5;
mu = 0.1;
g = 0.6:.001:1.3;

% Call subroutines to calc X1r and X2r
X1r = calc_X1r(zeta,g,f,mu);
X2r = calc_X2r(zeta,g,f,mu);
%%
plot(g,X1r) %[output:02152d54]
hold on; %[output:02152d54]
plot(g,X2r) %[output:02152d54]
hold on; %[output:02152d54]
%lgd = legend('X1r_{machine}, zeta = 0.1, mu = 0.05', 'X2r_{absorber}, zeta = 0.1, mu = 0.05','X1r_{machine}, zeta = 0.1, mu = 0.1', 'X2r_{absorber}, zeta = 0.1, mu = 0.1', 'X2r_{absorber}, zeta = 0.5, mu = 0.05');
