%[text] 4: Interpretation of results:
%[text] First, it can be seen from the plot that the amplitude of the absorber mass ($X\_2$) is always much greater than that of the main mass ($X\_1$). Which indicates that the design will be able to accommodate the large amplitudes of the absorber mass.
%[text] - Since the amplitudes of $m\_2$ are expected to be large, the absorber spring $k\_2$ needs to be designed from a fatigue point of view. \
%[text] The amplitude of vibration of the main mass is significantly reduced at the known impressed frequency $g = \\omega / \\omega\_n = 1$, to ~4.0. This inidicates that the operating frequency $\\omega$ is being kept away from resonance.
%[text] - Note: Most vibration absorbers used in practice are **undamped**; in a damped vibration absorber, the amplitude of vibration of the main mass will be non-zero (as seen in the plot).  \
